//will display product images with marquee animation. 
import React from 'react';
import ProductCard from './ProductCard.jsx'

//responsible for rendering the ProductCard Component. 


const ProductsDisplay = (props) =>  {
   const arr = this.props.imageUrls 
  const productImages = arr.map((imageUrl, index => <ProductCard imageUrls={imageUrl} />))
  return(
    <div>
      {productImages}
    </div> 
  )
}




export default ProductsDisplay;
